import React, { useState, useEffect } from 'react';
import {
  Box,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  TextField,
  ToggleButton,
  ToggleButtonGroup,
  Chip,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Rating,
  Stack
} from '@mui/material';
import { Group as TeamIcon, Extension as SkillIcon, Add as AddIcon, Edit as EditIcon } from '@mui/icons-material';
import { parseSkillsCSV, SkillCSV, getSkillsByCategory, getAllCategories } from '../utils/skillsUtils';
import { useUsers } from './UserContext';
import { User, UserSkill } from '../types/User';

type ViewMode = 'skills' | 'teams';

interface SkillDialogProps {
  open: boolean;
  onClose: () => void;
  user: User;
  allSkills: SkillCSV[];
  onSave: (userId: number, newSkills: UserSkill[]) => void;
}

const SkillDialog: React.FC<SkillDialogProps> = ({ open, onClose, user, allSkills, onSave }) => {
  const [selectedSkills, setSelectedSkills] = useState<UserSkill[]>(user.skills || []);
  const [newSkill, setNewSkill] = useState<string>('');
  const [newSkillLevel, setNewSkillLevel] = useState<number>(3);
  const [newSkillYears, setNewSkillYears] = useState<number>(1);

  const handleAddSkill = () => {
    if (!newSkill) return;

    setSelectedSkills(prev => [
      ...prev,
      {
        skillId: newSkill,
        level: newSkillLevel,
        yearsOfExperience: newSkillYears
      }
    ]);

    setNewSkill('');
    setNewSkillLevel(3);
    setNewSkillYears(1);
  };

  const handleRemoveSkill = (skillId: string) => {
    setSelectedSkills(prev => prev.filter(skill => skill.skillId !== skillId));
  };

  const handleSave = () => {
    onSave(user.id, selectedSkills);
    onClose();
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>Edit Skills - {user.name}</DialogTitle>
      <DialogContent>
        <Stack spacing={3} sx={{ mt: 2 }}>
          <Box sx={{ display: 'flex', gap: 2, alignItems: 'flex-end' }}>
            <FormControl fullWidth>
              <InputLabel>Add Skill</InputLabel>
              <Select
                value={newSkill}
                label="Add Skill"
                onChange={(e) => setNewSkill(e.target.value)}
              >
                {allSkills
                  .filter(skill => !selectedSkills.some(s => s.skillId === skill.id))
                  .map(skill => (
                    <MenuItem key={skill.id} value={skill.id}>
                      {skill.name} ({skill.category})
                    </MenuItem>
                  ))}
              </Select>
            </FormControl>
            <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', minWidth: 120 }}>
              <Typography component="legend">Level</Typography>
              <Rating
                value={newSkillLevel}
                onChange={(_, value) => setNewSkillLevel(value || 3)}
              />
            </Box>
            <TextField
              label="Years"
              type="number"
              value={newSkillYears}
              onChange={(e) => setNewSkillYears(Number(e.target.value))}
              sx={{ width: 100 }}
              inputProps={{ min: 0, step: 1 }}
            />
            <Button
              variant="contained"
              onClick={handleAddSkill}
              disabled={!newSkill}
              startIcon={<AddIcon />}
            >
              Add
            </Button>
          </Box>

          <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap' }}>
            {selectedSkills.map(userSkill => {
              const skill = allSkills.find(s => s.id === userSkill.skillId);
              return skill ? (
                <Chip
                  key={userSkill.skillId}
                  label={`${skill.name} (${userSkill.level}★, ${userSkill.yearsOfExperience}y)`}
                  onDelete={() => handleRemoveSkill(userSkill.skillId)}
                  color="primary"
                />
              ) : null;
            })}
          </Box>
        </Stack>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={handleSave} variant="contained">Save</Button>
      </DialogActions>
    </Dialog>
  );
};

const SkillsMatrix: React.FC = () => {
  const { users, setUsers } = useUsers();
  const [skills, setSkills] = useState<SkillCSV[]>([]);
  const [categories, setCategories] = useState<string[]>([]);
  const [selectedCategory, setSelectedCategory] = useState<string>('');
  const [searchTerm, setSearchTerm] = useState<string>('');
  const [viewMode, setViewMode] = useState<ViewMode>('skills');
  const [selectedTeams, setSelectedTeams] = useState<string[]>([]);
  const [editingUser, setEditingUser] = useState<User | null>(null);

  // Get unique teams from users
  const teams = React.useMemo(() => {
    return Array.from(new Set(users.map(user => user.team)));
  }, [users]);

  useEffect(() => {
    const loadSkills = async () => {
      const loadedSkills = await parseSkillsCSV();
      setSkills(loadedSkills);
      setCategories(getAllCategories(loadedSkills));
    };

    loadSkills();
  }, []);

  const handleTeamToggle = (team: string) => {
    setSelectedTeams(prev => {
      if (prev.includes(team)) {
        return prev.filter(t => t !== team);
      }
      return [...prev, team];
    });
  };

  const handleUpdateUserSkills = (userId: number, newSkills: UserSkill[]) => {
    setUsers(prevUsers => 
      prevUsers.map(user => 
        user.id === userId 
          ? { ...user, skills: newSkills }
          : user
      )
    );
  };

  return (
    <Box sx={{ p: 3 }}>
      <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <Typography variant="h4">Skills Matrix</Typography>
        <ToggleButtonGroup
          value={viewMode}
          exclusive
          onChange={(e, newMode) => newMode && setViewMode(newMode)}
          size="small"
        >
          <ToggleButton value="skills">
            <SkillIcon sx={{ mr: 1 }} />
            By Skills
          </ToggleButton>
          <ToggleButton value="teams">
            <TeamIcon sx={{ mr: 1 }} />
            By Teams
          </ToggleButton>
        </ToggleButtonGroup>
      </Box>

      <Box sx={{ mb: 3, display: 'flex', gap: 2, flexWrap: 'wrap' }}>
        <TextField
          label="Search Skills"
          variant="outlined"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          sx={{ minWidth: 200 }}
        />

        {viewMode === 'skills' ? (
          <FormControl sx={{ minWidth: 200 }}>
            <InputLabel>Category</InputLabel>
            <Select
              value={selectedCategory}
              label="Category"
              onChange={(e) => setSelectedCategory(e.target.value)}
            >
              <MenuItem value="">All Categories</MenuItem>
              {categories.map((category) => (
                <MenuItem key={category} value={category}>
                  {category}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
        ) : (
          <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap', alignItems: 'center' }}>
            {teams.map((team) => (
              <Chip
                key={team}
                label={team}
                onClick={() => handleTeamToggle(team)}
                color={selectedTeams.includes(team) ? 'primary' : 'default'}
                variant={selectedTeams.includes(team) ? 'filled' : 'outlined'}
              />
            ))}
          </Box>
        )}
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>User</TableCell>
              <TableCell>Team</TableCell>
              <TableCell>Skills</TableCell>
              <TableCell align="right">Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {users
              .filter(user => {
                if (viewMode === 'teams' && selectedTeams.length > 0) {
                  return selectedTeams.includes(user.team);
                }
                return true;
              })
              .filter(user => 
                searchTerm ? user.name.toLowerCase().includes(searchTerm.toLowerCase()) : true
              )
              .map((user) => (
                <TableRow key={user.id}>
                  <TableCell>{user.name}</TableCell>
                  <TableCell>
                    <Chip 
                      label={user.team} 
                      size="small"
                      color="primary"
                      variant="outlined"
                    />
                  </TableCell>
                  <TableCell>
                    <Box sx={{ display: 'flex', gap: 0.5, flexWrap: 'wrap' }}>
                      {user.skills?.filter(userSkill => {
                        const skill = skills.find(s => s.id === userSkill.skillId);
                        if (!skill) return false;

                        if (viewMode === 'teams' && selectedTeams.length > 0) {
                          return selectedTeams.some(team => skill.category === team);
                        }

                        if (viewMode === 'skills' && selectedCategory) {
                          return skill.category === selectedCategory;
                        }

                        return true;
                      }).map(userSkill => {
                        const skill = skills.find(s => s.id === userSkill.skillId);
                        return skill ? (
                          <Chip
                            key={userSkill.skillId}
                            label={`${skill.name} (${userSkill.level}★, ${userSkill.yearsOfExperience}y)`}
                            size="small"
                            variant="outlined"
                          />
                        ) : null;
                      })}
                    </Box>
                  </TableCell>
                  <TableCell align="right">
                    <IconButton 
                      onClick={() => setEditingUser(user)}
                      size="small"
                      color="primary"
                    >
                      <EditIcon />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
          </TableBody>
        </Table>
      </TableContainer>

      {editingUser && (
        <SkillDialog
          open={true}
          onClose={() => setEditingUser(null)}
          user={editingUser}
          allSkills={skills}
          onSave={handleUpdateUserSkills}
        />
      )}
    </Box>
  );
};

export default SkillsMatrix;
